pragma solidity ^0.4.21;

import "../node_modules/zeppelin-solidity/contracts/token/ERC20/StandardToken.sol";
contract DNextToken is StandardToken {
    uint public INITIAL_SUPPLY = 21000000;
    string public name = "DNextToken";
    string public symbol = "DNX";
    uint8 public decimals = 8;
    address owner;

    function DNEXT_Token() public {
        totalSupply_ = INITIAL_SUPPLY * 10 * uint(decimals);
        balances[msg.sender] = INITIAL_SUPPLY;
        owner = msg.sender;
    }

    bool public released = false;
    
    //계약 배포시에는 released 변수는 false로 초기화 되어 있다.
    //이 값이 true로 바뀌어야지만 토큰이 기능 실행
    // released 변수가 true 혹은 false인지 여부와는 관계없이 계약은 이미 배포가 되어있다.
    // 때문에 출시라는 개념은 인위적인 개념이고, 크라우드 세일이 끝나기전까지 토큰을 사용할 수 없도록
    // 막아 놓은 것을 뜻함 크라우드 세일이 끝나면 토큰 발행자는 release함수 호출
    function release() public {
        require(owner == msg.sender);
        require(!released);
        released = true;
    }
    //_;의 의미는 해당 변경자가 적용된 함수의 실제 내용을 나타냄
    modifier onlyReleased() {
        require(released);
        _;
    }

    function transfer(address to, uint256 value) public onlyReleased returns (bool) {
        super.transfer(to, value);
    }
    function allowance(address owner, address spender) public onlyReleased view returns (uint256) {
        super.allowance(owner,spender);
    }
    function transferFrom(address from, address to, uint256 value) public onlyReleased returns (bool) {
        super.transferFrom(from, to, value);
    }
    function approve(address spender, uint256 value) public onlyReleased returns (bool) {
        super.approve(spender,value);
    }

    mapping(bytes32 => bool) whitelist;

    //external : 외부 계정만 실행 가능 
    function register() external {
        whitelist[keccak256(msg.sender)] = true;
    }

    function unregister() external {
        whitelist[keccak256(msg.sender)] = false;
    }

    //view는 상태 변경을 하지 않겠다. (변수 변경, 이벤트 발생, 다른 계약 생성)
    function isRegistered(address anaddress) public view returns (bool registered) { 
        return whitelist[keccak256 (anaddress)];
    }

    

}
